def compute_ping_pong_combinations(layers):
    combinations = {}
    for i in range(len(layers)):
        if i != 0:  # not the first layer
            combinations[f"ping.{layers[i-1]}.{layers[i]}"] = False
            combinations[f"pong.{layers[i]}.{layers[i-1]}"] = False
        if i != len(layers) - 1:  # not the last layer
            combinations[f"ping.{layers[i+1]}.{layers[i]}"] = False
            combinations[f"pong.{layers[i]}.{layers[i+1]}"] = False
    return combinations

public static int WriteDelta<T>(ref T prev, T cur) where T : unmanaged
    {
        var prevBytes = MemoryMarshal.Cast<T, byte>(new T[] { prev });
        var curBytes = MemoryMarshal.Cast<T, byte>(new T[] { cur });

        var changes = 0;
        for(int i = 0; i < sizeof(T);i++)
        {
            if(prevBytes[i] != curBytes[i])
            {
                prevBytes[i] = curBytes[i];
                changes++;
            }
        }

        prev = MemoryMarshal.Cast<byte, T>(prevBytes)[0];

        return changes;
    }

